import React from 'react';
import { Container } from 'reactstrap';

const InventoryVisibility = () => {
  return (
    <Container>
      <h4 className='pt-4 pb-5'>Inventory Visibility</h4>
      <div className='d-flex w-100 h-100'>
        <div className='d-flex w-25 h-100' style={{ backgroundColor: 'gray' }}>
          <div className='d-flex w-100 justify-content-center'>
            <h5>Category</h5>
          </div>
        </div>
        <div
          className='d-flex w-75 h-100 ml-1'
          style={{ backgroundColor: 'blue' }}></div>
      </div>
    </Container>
  );
};

export default InventoryVisibility;
